(530, 6, 'tl_news', 32, 1433334851, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Weit hinten, hinter den Wortbergen, fern der L√§nder Vokalien und Konsonantien leben die Blindtexte. Abgeschieden wohnen sie in Buchstabhausen an der K√ºste des Semantik, eines gro√üen Sprachozeans. Ein kleines B√§chlein namens Duden flie√üt durch ihren Ort und versorgt sie mit den n√∂tigen Regelialien. Es ist ein paradiesmatisches Land, in dem einem gebratene Satzteile in den Mund fliegen.</p>\n<p>Nicht einmal von der allm√§chtigen Interpunktion werden die Blindtexte beherrscht ‚Äì ein geradezu unorthographisches Leben. Eines Tages aber beschlo√ü eine kleine Zeile Blindtext, ihr Name war Lorem Ipsum, hinaus zu gehen in die weite Grammatik. Der gro√üe Oxmox riet ihr davon ab, da es dort wimmele von b√∂sen Kommata, wilden Fragezeichen und hinterh√§ltigen Semikoli, doch das Blindtextchen lie√ü sich nicht beirren.</p>', '1', 'ˇÄª}	ËÂ±z™\0\0ÙaÙ', '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
