(23, 3, 'tl_calendar_events', 64, 1424254709, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:27:"Dies ist ein Typoblindtext.";}', '<p>Dies ist ein Typoblindtext. An ihm kann man sehen, ob alle Buchstaben da sind und wie sie aussehen. Manchmal benutzt man Worte wie Hamburgefonts, Rafgenduks oder Handgloves, um Schriften zu testen. Manchmal S√§tze, die alle Buchstaben des Alphabets enthalten - man nennt diese S√§tze ¬ªPangrams¬´. Sehr bekannt ist dieser: The quick brown fox jumps over the lazy old dog. Oft werden in Typoblindtexte auch fremdsprachige Satzteile eingebaut (AVAIL¬Æ and Wefox‚Ñ¢ are testing aussi la Kerning), um die Wirkung in anderen Sprachen zu testen.</p>', '', NULL, '', '', '', '', '', '', '', '', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
