(742, 6, 'tl_article', 224, 1444282027, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:7:"Hambach";}', '<p align="justify">Hambach ist ein Ortsteil des s√ºdhessischen Heppenheims an der Bergstra√üe. Die Kreisstadt hat ca. 25.000 Einwohner, ca. 2.000 davon leben in Hambach. Der TSV Hambach selbst z√§hlte am 18.05.2012 genau 802 Mitglieder.</p>\n<p align="justify">Geschichtliches zu Hambach:<br>In einer Schenkungsurkunde von <strong>Kaiser Friedrich I.</strong>, auch<strong> Barbarossa</strong> genannt, wird der Ort Hambach, damals noch Heimbach genannt, schon im<strong> Jahre 1165 </strong>erw√§hnt. Im Schatten und Schutze der Starkenburg konnte sich die Gemeinde durch die St√ºrme der Zeit behaupten. Mit der Erstnennung in der kaiserlichen Urkunde kam die damals noch recht kleine Siedlung unter den Schutz der Landesherren. Die Bewohner waren Leibeigene zun√§chst der √Ñbte des Klosters Lorsch, und nach dessen Aufl√∂sung geh√∂rte die Gemeinde zum Erzbistum Mainz. Die kurmainzische Zeit endete f√ºr Hambach <strong>1461</strong>. In diesem Jahr wurde das Oberamt Starkenburg vom <strong>Kurf√ºrsten von Mainz</strong>, <strong>Dieter von Isenburg</strong>, an den Kurf√ºrsten der Pfalz, Friedrich I., verpf√§ndet. Damit kam Hambach unter pf√§lzische Verwaltung. Nach alten Urkunden √ºber den "Schutztribut", auch Zehnt genannt, reichte die Skala der Anbauprodukte von Kartoffeln √ºber Getreide bis hin zum Wein, der gerade heute im Bergst√§dter Raum eine vorrangige Stellung einnimmt. In wirtschaftlicher Hinsicht waren die Bewohner fr√ºher Bauern, vor allem M√ºller oder Besitzer von M√ºhlen, zu deren Antrieb die Wasserkraft des Bachlaufs genutzt wurde. Daf√ºr spricht der Name<strong> Hambach</strong> = Hagenbach = eingeengter Bach oder Heimbach. Heute hat sich die Struktur gewandelt. Die beiden ehemals bl√ºhenden Haupterwerbszweige spielen nicht mehr die Rolle wie in fr√ºheren Jahren. Hambach stellt nun eine Wohngemeinde mit zahlreichen Auspendlern dar, die in den nahen Betrieben Arbeit und Besch√§ftigung finden.</p>\n<p align="justify">Quelle: Internet-Seite der <a href="http://www.heppenheim.de">Stadt Heppenheim</a>.</p>\n<p align="justify">Falsch ist √ºbrigens, dass es sich hier um das etwas bekanntere <em>Hambach in der Pfalz</em>handelt, das durch die deutsche Revolution 1848/49 sowie das Hambacher Fest 1832 zu Bekanntheit kam.</p>', '1', 'é:ò∆HÂ¥ﬂº#{\0', '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:1:"1";s:4:"left";s:3:"0,5";s:5:"right";s:1:"2";s:3:"top";s:1:"1";s:4:"unit";s:2:"cm";}', '', '', '', 'left', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
