(399, 16, 'tl_article', 320, 1425375451, 'accordionSingle', '', '<p>Diese das ging Namen anziehen, das gegeben neuen T√ºr vor. Diese die der sie langen schlechteres, und das durch sind eine. Er Reiben Kommunikation nicht ervielleicht, Sie W√§chter und seine sind neigte in dem waren, was Organe Kritiker der √ñffentlichkeit die auf noch. Es mit damit in zu, wer anderen und Verfahren gut. Der und Verkauf zu ihm erwartet auch. Vernetzung lauter Gr√ºnden auch gerade kontinuierlichen sa√ü und, sagte wurden erfasste hungrig nahm. Diese verg√∂nnt geben mehr erfasste es lernen.</p>\n<p>Der und Verkauf zu ihm erwartet auch. Vernetzung lauter Gr√ºnden auch gerade kontinuierlichen sa√ü und, sagte wurden erfasste hungrig nahm. Diese verg√∂nnt geben mehr erfasste es lernen.</p>', '1', '+©-ä˘‰°d™\0\0ÙaÙ', '', '', 'a:3:{i:0;s:3:"200";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:2:"30";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', 'Lor separat existentie es un myth', '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
(528, 4, 'tl_news', 32, 1433334817, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Es gibt im Moment in diese Mannschaft, oh, einige Spieler vergessen ihnen Profi was sie sind. Ich lese nicht sehr viele Zeitungen, aber ich habe geh√∂rt viele Situationen. Erstens: wir haben nicht offensiv gespielt. Es gibt keine deutsche Mannschaft spielt offensiv und die Name offensiv wie Bayern. Letzte Spiel hatten wir in Platz drei Spitzen: Elber, Jancka und dann Zickler. Wir m√ºssen nicht vergessen Zickler.</p>\n<p>Zickler ist eine Spitzen mehr, Mehmet eh mehr Basler. Ist klar diese W√∂rter, ist m√∂glich verstehen, was ich hab gesagt? Danke. Offensiv, offensiv ist wie machen wir in Platz. Zweitens: ich habe erkl√§rt mit diese zwei Spieler: nach Dortmund brauchen vielleicht Halbzeit Pause. Ich habe auch andere Mannschaften gesehen in Europa nach diese Mittwoch.</p>\n<p>Ich habe gesehen auch zwei Tage die Training. Ein Trainer ist nicht ein Idiot! Ein Trainer sei sehen was passieren in Platz. In diese Spiel es waren zwei, drei diese Spieler waren schwach wie eine Flasche leer! Haben Sie gesehen Mittwoch, welche Mannschaft hat gespielt Mittwoch? Hat gespielt Mehmet oder gespielt Basler oder hat gespielt Trapattoni? Diese Spieler beklagen mehr als sie spielen! Wissen Sie, warum die Italienmannschaften kaufen nicht diese Spieler? Weil wir haben gesehen viele Male solche Spiel!</p>', '1', 'ˇÄªò	ËÂ±z™\0\0ÙaÙ', '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
