(514, 3, 'tl_news', 32, 1433334784, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Auch gibt es niemanden, der den Schmerz an sich liebt, sucht oder w√ºnscht, nur, weil er Schmerz ist, es sei denn, es kommt zu zuf√§lligen Umst√§nden, in denen M√ºhen und Schmerz ihm gro√üe Freude bereiten k√∂nnen. Um ein triviales Beispiel zu nehmen, wer von uns unterzieht sich je anstrengender k√∂rperlicher Bet√§tigung, au√üer um Vorteile daraus zu ziehen?</p>\n<p>Aber wer hat irgend ein Recht, einen Menschen zu tadeln, der die Entscheidung trifft, eine Freude zu genie√üen, die keine unangenehmen Folgen hat, oder einen, der Schmerz vermeidet, welcher keine daraus resultierende Freude nach sich zieht? Auch gibt es niemanden, der den Schmerz an sich liebt, sucht oder w√ºnscht, nur, weil er Schmerz ist, es sei denn, es kommt zu zuf√§lligen Umst√§nden, in denen M√ºhen und Schmerz ihm gro√üe Freude bereiten k√∂nnen.</p>', '1', 'ˇÄª¥	ËÂ±z™\0\0ÙaÙ', '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
(515, 2, 'tl_news', 32, 1433334800, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Weit hinten, hinter den Wortbergen, fern der L√§nder Vokalien und Konsonantien leben die Blindtexte. Abgeschieden wohnen sie in Buchstabhausen an der K√ºste des Semantik, eines gro√üen Sprachozeans. Ein kleines B√§chlein namens Duden flie√üt durch ihren Ort und versorgt sie mit den n√∂tigen Regelialien. Es ist ein paradiesmatisches Land, in dem einem gebratene Satzteile in den Mund fliegen.</p>\n<p>Nicht einmal von der allm√§chtigen Interpunktion werden die Blindtexte beherrscht ‚Äì ein geradezu unorthographisches Leben. Eines Tages aber beschlo√ü eine kleine Zeile Blindtext, ihr Name war Lorem Ipsum, hinaus zu gehen in die weite Grammatik. Der gro√üe Oxmox riet ihr davon ab, da es dort wimmele von b√∂sen Kommata, wilden Fragezeichen und hinterh√§ltigen Semikoli, doch das Blindtextchen lie√ü sich nicht beirren.</p>', '1', 'ˇÄª•	ËÂ±z™\0\0ÙaÙ', '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
