(580, 165, 'tl_article', 256, 1440325867, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<h1>Willkommen beim TSV Hambach</h1>\n<p>Lieber Besucher,</p>\n<p>wir hei√üen Dich herzlich auf unserer neu gestalteten Homepage des TSV Hambach 1899 e. V. willkommen und w√ºnschen viel Spa√ü beim Erkunden der neuen Site. Du wirst hier alles wiederfinden, was Dir an der alten Homepage wichtig und teuer war.</p>\n<p>Fu√üball-Berichte der vergangenen Spiele und die Vorschau auf den n√§chsten Spieltag ebenso wie der Hinweis auf Veranstaltungen, einen ausf√ºhrlichen Jugendbereich und viele interessante News. Die Bereiche Tischtennis und Turnen sind als wichtiger Bestandteil unseres Vereins weiter wie gewohnt vertreten.</p>\n<p>An dieser Stelle bedanken wir uns bei allen, die mitgeholfen haben, diesen neuen Internetauftritt zu erm√∂glichen und die auch f√ºr die Inhalte sorgen.</p>\n<p>Viel Spa√ü beim neu entdecken !</p>\n<p><a class="btn" href="#">Mehr √ºber uns</a></p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:8:"col-lg-6";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
