(703, 208, 'tl_article', 64, 1440755319, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Die "Alten Herren" des TSV Hambach sind gar nicht soo alt - oder meinen es zumindest. Deswegen treffen sie sich jede Woche wieder zu Trainingseinheiten, die ganz wesentlich durch die 3. Halbzeit bestimmt werden. Die Verbindung von Sport und Geselligkeit wird hier gro√ü geschrieben.</p>\n<p>Der Kader der AH umfasst rund 40 Spieler, die wir aber auch ben√∂tigen, da der Samstag oft auch im Zeichen der Familie steht und es so manchmal schwer f√§llt, die ben√∂tigten 11 bis 15 Spieler zusammen zu bringen. Nichts desto trotz l√§uft der Spielbetrieb das ganze Jahr mit Ausnahme der Ferienzeit. In 2015 wurden 9 der vereinbarten 12 Spiele (3 Absagen der Gegner) absolviert und mit 5 Siegen und einem Unentschieden ein beachtliches, wenngleich auch verbesserungsw√ºrdiges Ergebnis erzielt (Torverh√§ltnis 23:17). Historisch hierbei war der 1:0 Ausw√§rtserfolf der AH √ºber den Lokalrivalen Starkenburgia Heppenheim am letzten Spieltag vor der Sommerpause (18.07.2015).</p>\n<p>[nbsp]</p>\n<p><a href="http://www.11freunde.de/artikel/die-typologie-einer-hobby-fussballmannschaft" target="blank">Die Typologie einer Hobby-Fu√üballmannschaft</a></p>\n<p>[nbsp]</p>\n<p>Die Spiele in der √úbersicht:</p>\n<p>"<strong>SPIELTAGE</strong> AH 2015" - Bitte hier auch mit Alex sprechen, siehe 1. u. 2. Mannschaft (Spiele, Torsch√ºtzen etc)</p>\n<table class="ahtab" width="97%" cellspacing="0" align="left">\n<tbody>\n<tr class="gray">\n<td id="td0">14. Februar</td>\n<td>TSV Hambach</td>\n<td>-</td>\n<td>TSV Zweite Mannschaft</td>\n<td>2:0 (0:0)</td>\n</tr>\n<tr class="gray">\n<td>[nbsp]</td>\n<td style="font-size: 8pt;" colspan="4">Tore AH: Kl√ºver, Bitsch</td>\n</tr>\n<tr>\n<td id="td1">21. M√§rz</td>\n<td>Kirschhausen</td>\n<td>-</td>\n<td>TSV Hambach</td>\n<td>3:0 (2:0)</td>\n</tr>\n<tr class="gray">\n<td id="td2">28. M√§rz</td>\n<td>TSV Hambach</td>\n<td>-</td>\n<td>FSG Bensheim</td>\n<td>5:2 (2:0