(724, 229, 'tl_article', 320, 1442500767, 'text', 'a:2:{s:4:"unit";s:2:"h2";s:5:"value";s:65:"Kreisliga B, 1. Spieltag, Sonntag 16.08.2015, Spielbeginn: 15 Uhr";}', '<p style="text-align: justify;"><strong>TSV Hambach ‚Äì SV Kirschhausen</strong></p>\n<p style="text-align: justify;">Unsere erste Mannschaft erwartet am kommenden Sonntag zum Auftakt der neuen Saison den SV Kirschhausen. Die G√§ste sind der meistgenannte und designierte Meisterschaftsfavorit in der Kreisliga B und somit schon zum Saisonstart ein echter Pr√ºfstein f√ºr TSV-Trainer Frank Zimmermann‚Äôs Team. Dem Derby sieht er optimistisch und mit Freude entgegen. ‚ÄûMeine Mannschaft hat eine gute Vorbereitung absolviert, wenngleich der Saisonauftakt gerne 14 Tage sp√§ter h√§tte kommen d√ºrfen, um alle Spieler gesund an Bord zu haben‚Äú. Er traut seinen Jungs auch am Sonntag einiges zu, warnt aber gleichzeitig und vorausschauend: ‚Äûbei uns ist alles m√∂glich, aber unabh√§ngig vom Ergebnis ist es wichtig, das die Jungs sich in den kommenden Wochen stabilisieren‚Äú.</p>\n<p style="text-align: justify;">Neben dem Ortsnachbarn Kirschhausen wird es der TSV im Saisonverlauf mit einer Vielzahl weiterer ambitionierter B-Ligisten zu tun haben, die sich im Meisterschaftskampf gut aufgestellt sehen (siehe Anhang Saisonvorschau). Mit dem SSV Reichenbach, SV L√∂rzenbach, FSV Zotzenbach, VfL Birkenau II, TSV Elmshausen, FC Sch√∂nmattenwag, sowie Aufsteiger VfB Lampertheim sieht sich fast die H√§lfte aller Teams im Aufstiegsrennen gut positioniert! Es wird spannend sein zu beobachten, welches Wunschdenken am Ende auf der Strecke bleibt‚Ä¶</p>\n<p style="text-align: justify;">[nbsp]</p>\n<p style="text-align: justify;"><strong>Unserer Ersten Mannschaft w√ºnsche ich am Sonntag ein erfolgreiches Derby gegen Kirschhausen und einen erfolgreichen und verletzungsfreien Saisonverlauf!</strong></p>\n<p style="text-align: justify;">[nbsp]</p>', '', '$ôî	ÈÂ±z™\0\0ÙaÙ', '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:9:"col-lg-11";}', 'a:2:{i:0;s:2:"10";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default');
