(229, 77, 128, 1440166665, 'News', 'news-229', 6, 'main', '', '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '<p>[nbsp]</p>\n<p>auch wenn unsere erste Mannschaft am vergangenen Sonntag mit dem SV Kirschhausen[nbsp]<em>den[nbsp]</em>Meisterschaftsfavoriten schlechthin zu Gast hatte: die deutliche 0:3-Niederlage war zum Saisonauftakt mehr als ern√ºchternd. √úber die Leistung seines Teams war Trainer Frank Zimmermann entsprechend entt√§uscht. ‚ÄûIch kann allenfalls damit zufrieden sein, das sich die Jungs[nbsp] nach der verschlafenen Anfangsphase und dem fr√ºhen 0:2-R√ºckstand nicht aufgegeben haben. Aber letztendlich hat uns Kirschhausen gezeigt, mit welcher Einstellung und mannschaftlicher Geschlossenheit ein Derby gespielt werden muss‚Äú. Mit Blick auf das kommende Ausw√§rtsspiel f√ºgte er hinzu: ‚Äûwenn wir uns in diesen Bereichen nicht erheblich steigern, k√∂nnte Hammelbach der n√§chste Stolperstein werden‚Äú. Unser kommender Gegner blieb am ersten Spieltag ebenso tor- und erfolglos wie der TSV und verlor beim VfR Fehlheim II (0:2), scheiterte jedoch laut Pressebericht trotz ansprechender Leistung vor allem an der mangelnden Chancenverwertung. Unserem Team bietet die Begegnung im Odenwald die Chance zur Wiedergutmachung und nat√ºrlich vor allem die M√∂glichkeit einen kompletten Fehlstart zu vermeiden. Ein Punktgewinn sollte f√ºr den TSV das Minimalziel sein!</p>\n<p>[nbsp]</p>\n<p>[nbsp]</p>\n<p><strong>Kreisliga B, 2. Spieltag,[nbsp]<a href="x-apple-data-detectors://0">Sonntag 23.08.2015</a>, Spielbeginn:[nbsp]<a href="x-apple-data-detectors://1">15 Uhr</a></strong></p>\n<p><strong>SG Hammelbach/Scharbach - TSV Hambach</strong></p>\n<p><strong>[nbsp]</strong></p>\n<p><strong>[nbsp]</strong></p>\n<ol start="2">\n<li><strong> Mannschaft Freundschaftsspiel,[nbsp]<a href="x-apple-data-detectors://2">Sonntag 23.08.2015</a>, Spielbeginn:[nbsp]<a href="x-apple-data-detectors://3">13 Uhr</a></strong></li>\n</ol>\n<p><strong>FV Hofheim II ‚Äì TSV Hambach II</strong></p>\n<p>Die zweite Mannschaft bestreitet eine Woche vor Rundenbeginn ein weiteres Vorbereitungsspiel beim FV Hofheim II. Am vergangenen Sonntag verlor die Elf von Spielertrainer Andreas Davidowicz gegen den VfB Lampertheim II nach einer 2:0-F√ºhrung am Ende mit 2:3.</p>\n<p>[nbsp]</p>\n<p>[nbsp]</p>\n<p><strong>Beiden TSV-Teams w√ºnsche ich viel Erfolg und insbesondere unserer Ersten Mannschaft die ersten Punkte beim Spiel in Hammelbach!</strong></p>', '', '', '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '1', '', ''),
