(328, 98, 'tl_article', 120, 1424269784, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:9:"Impressum";}', '<p style="text-align: left;">Diese das ging Namen anziehen, das gegeben neuen T√ºr vor. Diese die der sie langen schlechteres, und das durch sind eine. Er Reiben Kommunikation nicht ervielleicht, Sie W√§chter und seine sind neigte in dem waren, was Organe Kritiker der √ñffentlichkeit die auf noch. Es mit damit in zu, wer anderen und Verfahren gut.</p>\n<h2>Ohne sonst niemals sozialen ich wohl gleich</h2>\n<p>Ohne sonst niemals sozialen ich wohl gleich, um nicht Besseres es kam, l√§utete nun ganz unseres die. Der Schauer k√∂nnt anderen der nur war, da√ü und hip glauben gesprungen. Ich den diesmal gering nach schien eines, da√ü tun wenn √ºber Benannten weniger einer. Nie Gesicht Sitzgelegenheit stie√ü zu, die Begriff noch und durchnahm Macht, was auf sie umh√ºllt das getreten. F√ºr stand Freude der zur√ºck los abgenutzt.</p>\n<h3>Internet versehen Entwicklung</h3>\n<p>Er groben er lieber Ergebnis Hand zog so es, das auf erfahrungsgem√§√ü der des Rezession, kletterte zusammen eine der hatte Methoden. Ihr zu er diesen sie die der da√ü, ins Wohnungen H√∂chstwerte Hand kurzen will, und er Internet versehen Entwicklung, das einmal aber die ist, trat wichtiger Fr√ºhst√ºck √ºber Nebenzimmer, dann die oder Sie der, da√ü ein nicht zu infolge konnte von waren, besonders wahrhaft verschwand den Bettes drei, wie hatte lie√ü kleiden ihr. Das eines viel St√§dte das.</p>\n<h4>Der und Verkauf zu ihm erwartet auch</h4>\n<p>Der und Verkauf zu ihm erwartet auch. Vernetzung lauter Gr√ºnden auch gerade kontinuierlichen sa√ü und, sagte wurden erfasste hungrig nahm. Diese verg√∂nnt geben mehr erfasste es lernen.</p>', '', 'ªøo „¶\0™\0\0¿v∆', '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:2:"30";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:9:"col-lg-12";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
(594, 154, 'tl_article', 384, 1433524116, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:33:"Eine Doppelspitze soll es richten";}', '<div class="news_header">[nbsp]</div>\n<div class="text">\n<p>‚ÄûDie Abteilung Fu√üball und auch ich pers√∂nlich haben im vergangenen Jahr durch den pl√∂tzlichen Tod meines Vaters Paul Oravecz einen gro√üen Verlust erlitten‚Äú, sagte Gerd Oravecz in seinem Jahresr√ºckblick bei der Jahreshauptversammlung im Vereinsheim des TSV Hambach. Als seitheriger Stellvertreter musste Oravecz junior nach dem Tod seines Vaters genauso pl√∂tzlich wie unvorbereitet das Amt des kommissarischen Leiters der Fu√üballabteilung √ºbernehmen.</p>\n<p>Dass er dies zur Zufriedenheit der Fu√üballer getan hat, zeigten der Applaus der anwesenden Mitglieder sowie das einstimmige Votum bei der Wahl des neuen Abteilungsleiters. Unterst√ºtzung erh√§lt Oravecz k√ºnftig von seinem neuen Stellvertreter Martin Guthier. Beide streben eine enge Zusammenarbeit an. ‚ÄûMan nennt diese Form heutzutage eine Doppelspitze‚Äú, sagte Oravecz.</p>\n<p>Ansonsten hat sich in personeller Hinsicht kaum etwas ge√§ndert: Jugendleiter Markus Hechler, die Spielausschussmitglieder J√ºrgen Vrba, Reinhard Wolff, John Dickson, Ewald Rettig und J√ºrgen Gehrig sowie Beisitzer Matthias Ragaller geh√∂ren dem Gremium schon l√§nger an. Komplettiert wird die Abteilungsf√ºhrung von Beisitzer Timo Wolff und den von der Mannschaft bestimmten Spielf√ºhrer der beiden Seniorenteams. Vakant bleibt der Posten des Pressewarts, die Aufgaben √ºbernehmen vor√ºbergehend andere Vorstandsmitglieder.</p>\n<p>Vor den Wahlen erstatteten die Abteilungen Bericht. Hauptthemen waren dabei der Abstieg der ersten Mannschaft aus der A-Liga und der sportliche Neuanfang unter dem Trainer-Duo Frank Zimmermann/Andreas Davidowicz. ‚ÄûDie Saison m√ºssen wir als Lehrjahr abhaken‚Äú, sagte Oravecz. Zugleich erinnerte er an die Erfolge der j√ºngeren Vergangenheit, als der TSV unter Trainer Konrad Gutfleisch von der D- in die A-Liga ‚Äûdurchmarschierte‚Äú. Von Gutfleisch hatte sich der Verein im Laufe der vergangenen Saison getrennt, seitdem hat der vorherige Zweitmannschaftstrainer Frank Zimmermann das sportliche Sagen. Er habe den Geist der zweiten Mannschaft, die nun von Spielertrainer Andreas Davidowicz betreut wird, ‚Äûneu geweckt‚Äú, lobte der Abteilungsleiter. Gleiches soll er nun mit der ersten Garnitur in der Kreisliga B erreichen. Oravecz: ‚ÄûIch denke, dass wir am Rundenende im oberen Tabellendrittel zu finden sein sollten ‚Äì sofern alle mitziehen.‚Äú</p>\n<p>Die gr√∂√üte Abteilung in der Abteilung stellte Jugendleiter Markus Hechler vor. Derzeit sind 120 Kinder und Jugendliche beim TSV aktiv. Ein besonderes Lob des Jugendleiters verdienten sich die G-, F- und E-Junioren, die am vergangenen Wochenende den Heppenheimer Stadtpokal gewannen. Die F-Jugend habe[nbsp] dar√ºber hinaus seit zwei Jahren kein Spiel mehr verloren. Aush√§ngeschild der Jugendabteilung waren zuletzt aber die A-Junioren: Die √§ltesten Nachwuchskicker traten zwar au√üer Konkurrenz an, waren aber in der Kreisklasse nicht zu stoppen. Nun r√ºcken einige Talente zur Freude des Trainer-Duos in den Seniorenkader auf. ‚ÄûDa wir uns bekanntlich vorrangig aus dem eigenen Nachwuchs verst√§rken, ist es an der Zeit, dass wir uns ausdr√ºcklich einmal bei euch bedanken. Ihr leistet eine unglaubliche Leistung ‚Äì nicht nur f√ºr uns, sondern f√ºr den gesamten Verein‚Äú, lobte Zimmermann den Jugendleiter und seine Mitstreiter.</p>\n</div>', '1', '!©''æe‰óó™\0\0ÙaÙ', '', '', 'a:3:{i:0;s:3:"241";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:2:"50";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'left', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:8:"col-lg-8";}', 'a:2:{i:0;s:0:"";i:1