(513, 1, 'tl_news', 32, 1447086872, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:19:"Fu√üball Newsletter";}', '<p><strong>Kreisliga B, 12 Spieltag, Sonntag 01.11.2015, Spielbeginn: 15 Uhr</strong></p>\n<p><strong>TSV Hambach ‚Äì FSV Zotzenbach</strong></p>\n<p>Fussball-Abteilungsmitglied Matthias Ragaller lag mit seiner Einsch√§tzung zur Halbzeit des Spieles in Zotzenbach am vergangenen Sonntag richtig. ‚ÄûDie Jungs gewinnen noch mit 5:3‚Äú prophezeite er trotz eines 1:2-Pausenr√ºckstandes fast punktgenau. Bis dahin zeigte sich Frank Zimmermann‚Äôs Team nicht nur im Auslassen von hochkar√§tigen Chancen gro√üz√ºgig, sondern beg√ºnstigte Zotzenbach mit Abwehrgeschenken, die der FSV dankend zweimal annahm. Mit dem 1:3 in der 49. Spielminute war der Spielverlauf vollends auf den Kopf gestellt und die Partie schien gelaufen. Im letzten Spieldrittel belohnte sich unsere Mannschaft dann jedoch f√ºr eine gute und engagierte Gesamtleistung und wendete ein verlorengeglaubtes Spiel noch zum vielumjubelten und verdienten 4:3-Erfolg. ‚ÄûEs war beeindruckend wie mein Team nach den R√ºckschl√§gen zur√ºckgekommen ist‚Äú, analysierte Frank Zimmermann sichtlich zufrieden nach 90 intensiven Minuten. Ein Blick auf die Tabelle der Kreisliga B verr√§t, dass der TSV sich mit diesem Sieg ein ordentliches Polster auf die nachfolgend platzierten Konkurrenten erspielt hat. Den Blick darf man somit vor der kommenden Begegnung gegen das derzeitige Tabellenschlusslicht VfL Birkenau II durchaus nach oben richten und k√∂nnte, drei Punkte vorausgesetzt, am 13. Spieltag auf Rang F√ºnf klettern. F√ºr unser Trainerteam Zimmermann und Sch√∂n wird es in der Vorbereitung und Einstellung zum Spiel gegen Birkenau dann auch in erster Linie darum gehen der Mannschaft zu vermitteln, dass ein Sieg gegen die Odenw√§lder kein Selbstl√§ufer wird. Als warnendes und zu vermeidendes Beispiel d√ºrfte das magere 3:3-Unentschieden gegen den damaligen Tabellenletzten FSV Riedrode noch in lebhafter Erinnerung sein.</p>\n<p><strong>Kreisliga D, 10. Spieltag, Sonntag 01.11.2015, Spielbeginn: 12:45 Uhr</strong></p>\n<p>Unsere zweite Mannschaft verlor ihr Ausw√§rtsspiel beim jetzigen Tabellendritten SC Olympia Lorsch II mit 1:4. Im Fokus des 11. Spieltages steht nun die Begegnung beim Tabellenachten Starkenburgia Heppenheim II. Das Derby bietet die willkommene Gelegenheit Selbstvertrauen vor den letzten beiden Hinrundenspielen der Kreisliga D zu tanken. Die zweite der Heppenheimer belegt aktuell den achten Tabellenplatz. In diese Regionen zur√ºckzukehren, am besten beginnend mit einem Sieg im Derby, wird das Ziel von Spielertrainer Andreas Davidowicz sein.</p>\n<p>[nbsp]</p>\n<p>[nbsp]</p>\n<p><strong>Kreisliga B, 13. Spieltag, Sonntag 08.11.2015, Spielbeginn 14:30 Uhr</strong></p>\n<p><strong>TSV Hambach ‚Äì VfL Birkenau II</strong></p>\n<p><strong>[nbsp]</strong></p>\n<p><strong>Kreisliga D, 11. Spieltag, Sonntag 08.11.2015, Spielbeginn 12:45 Uhr</strong></p>\n<p><strong>Starkenburgia Heppenheim II - TSV Hambach II </strong></p>\n<p><strong>[nbsp]</strong></p>\n<p><strong>[nbsp]</strong></p>\n<p><strong>E-Junioren, Qualifikation zur Kreisliga</strong></p>\n<p>[nbsp]</p>\n<p>Nach den TSV-C-Junioren ist auch unserer von Heiko Neher betreuten E-Juniorenmannschaft (siehe Bild im Anhang) ein toller Erfolg gelungen! Die Jungs haben sich mit einer makellosen Bilanz von 4 Siegen in 4 Spielen und einem sensationellen Torverh√§ltnis von 60:4 (!) Toren f√ºr die Kreisliga qualifiziert. Bereits im Sommer diesen Jahres hatte das Team mit dem Gewinn des Heppenheimer Stadtpokals in ihrer Altersklasse f√ºr Furore gesorgt.</p>\n<p>[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
