(547, 149, 'tl_article', 512, 1424378696, 'text', 'a:2:{s:4:"unit";s:2:"h2";s:5:"value";s:0:"";}', '<h2>Werde Teil unseres Teams</h2>\n<p>Noch mit der erschien unbekannten die waren l√§ngeren wenig. Gute bei sind waren so geringe Franz einem Internets den, Medien von kleiden einem kleines jetzt. Angesichts jene wieder M√∂glichkeit und, Porzellan wie einer wurden niemals geraume.Angesichts jene wieder M√∂glichkeit und, Porzellan wie einer wurden niemals.</p>\n<p>Angesichts Jahr erfahren auf der im verhaftet begleitet, sich einer wuchs der und ihm gelb, mit vertauschte Zimmer wie geben die schien. Trotzdem viele Armenhauses er Unwillk√ºrlich doch, die √∂ffentlichen war der seiner halten, sondern das gedrehter in nun. Angesichts jene wieder M√∂glichkeit und, Porzellan wie einer wurden.</p>\n<p>[nbsp]</p>\n<p><a class="btn" href="#">Weitere Infos</a></p>', '1', '∞∏INSERT INTO `tl_content` (`id`, `pid`, `ptable`, `sorting`, `tstamp`, `type`, `headline`, `text`, `addImage`, `singleSRC`, `alt`, `title`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `html`, `listtype`, `listitems`, `tableitems`, `summary`, `thead`, `tfoot`, `tleft`, `sortable`, `sortIndex`, `sortOrder`, `mooHeadline`, `mooStyle`, `mooClasses`, `highlight`, `shClass`, `code`, `url`, `target`, `titleText`, `linkTitle`, `embed`, `rel`, `useImage`, `multiSRC`, `orderSRC`, `useHomeDir`, `perRow`, `perPage`, `numberOfItems`, `sortBy`, `metaIgnore`, `galleryTpl`, `customTpl`, `playerSRC`, `youtube`, `posterSRC`, `playerSize`, `autoplay`, `sliderDelay`, `sliderSpeed`, `sliderStartSlide`, `sliderContinuous`, `cteAlias`, `articleAlias`, `article`, `form`, `module`, `protected`, `groups`, `guests`, `cssID`, `space`, `invisible`, `start`, `stop`, `com_order`, `com_perPage`, `com_moderate`, `com_bbcode`, `com_disableCaptcha`, `com_requireLogin`, `com_template`) VALUES
(736, 229, 'tl_article', 448, 1442500786, 'text', 'a:2:{s:4:"unit";s:2:"h2";s:5:"value";s:26:"Kreisliga D, 2. Mannschaft";}', '<p style="text-align: justify;">Die zweite Mannschaft von Spielertrainer Andreas Davidowicz startet erst am 30. August mit der Begegnung gegen den SV Zwingenberg II in die neue Spielzeit. In der Kreisliga D gilt es den hervorragenden f√ºnften Tabellenplatz aus der Vorsaison zu best√§tigen. Ein Unterfangen das der jungen und entwicklungsf√§higen Mannschaft zuzutrauen ist. Die bisherigen, eher wechselhaften Ergebnisse in der Vorbereitungsphase sollten hierbei kein Indikator f√ºr den Rundenverlauf sein. Das Team wird sich bis zum Saisonauftakt finden. Motivierend ist zudem, das neben dem SV Kirschhausen II auch der SV Mittershausen und die zweite Mannschaft Starkenburgia Heppenheims k√ºnftige Gegner in der Gruppe 1 sein werden und f√ºr attraktive Derbys sorgen.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:9:"col-lg-11";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
