(755, 9, 'tl_article', 256, 1440666760, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:23:"TSV-Hambach sagt Danke!";}', '<p align="justify">Ohne die Unterst√ºtzung seiner Sponsoren k√∂nnte der TSV Hambach nicht existieren. Denn neben der aufopferungsvollen Arbeit unserer ehrenamtlichen Helfer und Betreuer sind es auch die Gelder unserer Sponsoren, die unseren Verein am Leben erhalten, unsere allseits bekannte und gelobte Jugendarbeit erm√∂glichen und uns beim Vorhaben des Kunstrasenprojektes unterst√ºtzen.</p>\n<p align="justify">An dieser Stelle m√∂chten wir uns bei unseren Partnern und Sponsoren bedanken und bitten unsere Leser, bei ihren K√§ufen die nebenstehenden Firmen zu ber√ºcksichtigen.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:8:"col-lg-6";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
