(992, 329, 'tl_article', 256, 1447089746, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:7:"Wandern";}', '<p align="justify"><strong><em>‚ÄûAn einem hellen Morgen, da nimm den Wanderstab,[nbsp]es fallen alle Sorgen wie Nebel von dir ab.‚Äú</em></strong></p>\n<p align="justify">Gem√§√ü dieser Empfehlung des deutschen Erz√§hlers Theodor Fontane erf√§hrt die Sparte Wandern beim TSV Hambach seit einem Vierteljahrhundert regen Zuspruch und ein erfolgreiches, naturverbundenes Wirken.</p>\n<p align="justify">Nachdem bereits in den f√ºnfziger und sechziger Jahren ‚Äì im j√§hrlichen Wechsel mit einem Busausflug ‚Äì eine Jahreswanderung vom TSV durchgef√ºhrt wurde, nahm das Wandern in Hambach mit Beginn der siebziger Jahre einen erfreulichen Aufschwung.</p>\n<p align="justify">Der am 30. September 2005 leider verstorbene August Ochs betreute im ersten Jahr 1974 kommissarisch und ab 1975 als gew√§hlter Wanderwart innerhalb der Abteilung Turnen die allzeit beliebte Freizeitbesch√§ftigung und machte das Wandern zu einem festen Bestandteil des Hambacher Vereinslebens. Von 1975 bis 1991 bekleidete Ochs gleichzeitig im Turngau Bergstra√üe das Amt des Gau-Wanderwartes und hat dabei √ºber die Grenzen Hambachs hinaus Pionierarbeit f√ºr den beliebten Breitensport geleistet.</p>\n<p align="justify">Ab 1995 bekleidet nun Gerhard Neher das Amt des Wanderwartes innerhalb der Turnabteilung. √úber die Turnabteilung, zur Leichtathletik, dann als Jogger kam er schlie√ülich zu den Wanderern.</p>\n<p align="justify">Zurzeit z√§hlen etwa 35 Personen zum Kreis der Wanderer, von denen sich wiederum zwischen 15 und 25 an den verschiedenen Wanderungen beteiligen. Hierbei wird nicht nur die n√§here Umgebung auf ‚ÄûSchusters Rappen‚Äú erwandert, sondern auch entfernte Regionen wie der Schwarzwald, der Pf√§lzer Wald und der Taunus aufgesucht.</p>\n<p align="justify">Die Summe der im j√§hrlichen Wanderplan ausgeschriebenen Termine ergibt etwa 15 Wanderungen mit einer Jahresgesamtstrecke von insgesamt 250 ‚Äì 300 km. Eine Radtour mit etwa 50 km L√§nge und ein Wanderwochenende mit zwei √úbernachtungen in einer Jugendherberge runden den Wanderplan ab.</p>\n<p align="justify">Letzteres wird wechselweise seit 1994 von den Wanderfreunden aus Bobstadt, Hambach und Zell organisiert.</p>\n<p align="justify">Seit dem Jahr 2000 wird j√§hrlich Mitte September ein 5-Tage Aufenthalt mit diversen Bergtouren im Allg√§u bzw. im Tannheim (√ñsterreich) durchgef√ºhrt. Die Organisation obliegt j√§hrlich einem anderen Wanderfreund der TSV-Truppe.</p>\n<p align="justify">Gem√§√ü der Devise: <em>‚ÄûWanderwetter ist immer, es kommt einzig und allein auf die richtige Kleidung an‚Äú</em></p>', '', NULL, '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
