INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES
(1, 1, 1447007016, 'Fu√üball Newsletter', 'gute-neuigkeiten-1', 1, 1457562180, 1457562180, '', '<p><strong>Kreisliga B, 1. Spieltag, Sonntag 16.08.2015, Spielbeginn: 15 Uhr</strong></p>\n<p><strong>TSV Hambach ‚Äì SV Kirschhausen</strong></p>\n<p>Unsere erste Mannschaft erwartet am kommenden Sonntag zum Auftakt der neuen Saison den SV Kirschhausen. Die G√§ste sind der meistgenannte und designierte Meisterschaftsfavorit in der Kreisliga B und somit schon zum Saisonstart ein echter Pr√ºfstein f√ºr TSV-Trainer Frank Zimmermann‚Äôs Team. Dem Derby sieht er optimistisch und mit Freude entgegen. ‚ÄûMeine Mannschaft hat eine gute Vorbereitung absolviert, wenngleich der Saisonauftakt gerne 14 Tage sp√§ter h√§tte kommen d√ºrfen, um alle Spieler gesund an Bord zu haben‚Äú. Er traut seinen Jungs auch am Sonntag einiges zu, warnt aber gleichzeitig und vorausschauend: ‚Äûbei uns ist alles m√∂glich, aber unabh√§ngig vom Ergebnis ist es wichtig, das die Jungs sich in den kommenden Wochen stabilisieren‚Äú.</p>\n<p>Neben dem Ortsnachbarn Kirschhausen wird es der TSV im Saisonverlauf mit einer Vielzahl weiterer ambitionierter B-Ligisten zu tun haben, die sich im Meisterschaftskampf gut aufgestellt sehen (siehe Anhang Saisonvorschau). Mit dem SSV Reichenbach, SV L√∂rzenbach, FSV Zotzenbach, VfL Birkenau II, TSV Elmshausen, FC Sch√∂nmattenwag, sowie Aufsteiger VfB Lampertheim sieht sich fast die H√§lfte aller Teams im Aufstiegsrennen gut positioniert! Es wird spannend sein zu beobachten, welches Wunschdenken am Ende auf der Strecke bleibt‚Ä¶</p>\n<p>[nbsp]</p>\n<p>[nbsp]</p>\n<p><strong>Kreisliga D, 2. Mannschaft</strong></p>\n<p>Die zweite Mannschaft von Spielertrainer Andreas Davidowicz startet erst am 30. August mit der Begegnung gegen den SV Zwingenberg II in die neue Spielzeit. In der Kreisliga D gilt es den hervorragenden f√ºnften Tabellenplatz aus der Vorsaison zu best√§tigen. Ein Unterfangen das der jungen und entwicklungsf√§higen Mannschaft zuzutrauen ist. Die bisherigen, eher wechselhaften Ergebnisse in der Vorbereitungsphase sollten hierbei kein Indikator f√ºr den Rundenverlauf sein. Das Team wird sich bis zum Saisonauftakt finden. Motivierend ist zudem, das neben dem SV Kirschhausen II auch der SV Mittershausen und die zweite Mannschaft Starkenburgia Heppenheims k√ºnftige Gegner in der Gruppe 1 sein werden und f√ºr attraktive Derbys sorgen.</p>\n<p>[nbsp]</p>\n<p><strong>Junioren und Alte Herren</strong></p>\n<p>√úber den Tellerrand der Senioren m√∂chte ich an dieser Stelle auch gerne immer mal wieder hinausschauen. Eine erfolgreiche Jugendarbeit unter der Leitung und wesentlichen Mitarbeit von Markus Hechler zeichnen den TSV Hambach in den vergangenen Jahren bekannterma√üen aus. Die daraus resultierenden sportlichen Erfolge bilden hierbei nat√ºrlich das vielzitierte ‚Äûi-T√ºpfelchen‚Äú. Im letzten Newsletter hatte ich bereits unsere erfolgreiche A-Jugend vorgestellt, die in der letzten Spielzeit Tabellenerster der Kreisklasse wurde. Heute habe ich einen Bericht unserer E-Junioren in den Anhang gestellt, die die abgelaufene Runde als Vizemeister in der Kreisklasse erfolgreich beendeten. Erw√§hnenswert dar√ºber hinaus zudem der seit Jahren lang ersehnte Sieg unserer AH-Mannschaft gegen den Lokalrivalen Starkenburgia Heppenheim (siehe ebenfalls Artikel im Anhang)!</p>\n<p>[nbsp]</p>\n<p><strong>Unserer Ersten Mannschaft w√ºnsche ich am Sonntag ein erfolgreiches Derby gegen Kirschhausen und einen erfolgreichen und verletzungsfreien Saisonverlauf!</strong></p>', '1', 'ˇÄª¬	ËÂ±z™\0\0ÙaÙ', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'internal', 77, 0, '', '', '', '', '', '1', '', ''),
(2, 1, 1433518623, 'Unser Unternehmen ist 10 Jahre alt!', 'unser-unternehmen-ist-10-jahre-alt', 1, 1447367040, 1447367040, '', '<p>Dies ist ein Typoblindtext. An ihm kann man sehen, ob alle Buchstaben da sind und wie sie aussehen. Manchmal benutzt man Worte wie Hamburgefonts, Rafgenduks oder Handgloves, um Schriften zu testen. Manchmal S√§tze, die alle Buchstaben des Alphabets enthalten - man nennt diese S√§tze ¬ªPangrams¬´. Sehr bekannt ist dieser: The quick brown fox jumps over the lazy old dog.</p>', '1', 'ˇÄª•	ËÂ±z™\0\0ÙaÙ', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', ''),
(3, 1, 1433518612, 'So war die Messe in Frankfurt', 'besucht-uns-auf-der-messe-in-frankfurt', 1, 1449613440, 1449613440, '', '<p>Es gibt im Moment in diese Mannschaft, oh, einige Spieler vergessen ihnen Profi was sie sind. Ich lese nicht sehr viele Zeitungen, aber ich habe geh√∂rt viele Situationen. Erstens: wir haben nicht offensiv gespielt. Es gibt keine deutsche Mannschaft spielt offensiv und die Name offensiv wie Bayern.</p>\n<p>Letzte Spiel hatten wir in Platz drei Spitzen: Elber, Jancka und dann Zickler. Wir m√ºssen nicht vergessen Zickler. Zickler ist eine Spitzen mehr, Mehmet eh mehr Basler. Ist klar diese W√∂rter, ist m√∂glich verstehen, was ich hab gesagt? Danke. Offensiv, offensiv ist wie machen wir in Platz.</p>', '1', 'ˇÄª¥	ËÂ±z™\0\0ÙaÙ', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', ''),
(4, 1, 1433518632, 'Gute Neuigkeiten!', 'gute-neuigkeiten-1-5885bc5e', 1, 1424338080, 1424338080, '', '<p>Zweitens: ich habe erkl√§rt mit diese zwei Spieler: nach Dortmund brauchen vielleicht Halbzeit Pause. Ich habe auch andere Mannschaften gesehen in Europa nach diese Mittwoch. Ich habe gesehen auch zwei Tage die Training. Ein Trainer ist nicht ein Idiot! Ein Trainer sei sehen was passieren in Platz. In diese Spiel es waren zwei, drei diese Spieler waren schwach wie eine Flasche leer! Haben Sie gesehen Mittwoch, welche Mannschaft hat gespielt Mittwoch?</p>', '1', 'ˇÄªò	ËÂ±z™\0\0ÙaÙ', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', ''),
(5, 1, 1433518641, 'So war die Messe in Frankfurt', 'besucht-uns-auf-der-messe-in-frankfurt-ed344b56', 1, 1424338080, 1424338080, '', '<p>Es gibt im Moment in diese Mannschaft, oh, einige Spieler vergessen ihnen Profi was sie sind. Ich lese nicht sehr viele Zeitungen, aber ich habe geh√∂rt viele Situationen. Erstens: wir haben nicht offensiv gespielt. Es gibt keine deutsche Mannschaft spielt offensiv und die Name offensiv wie Bayern.</p>\n<p>Letzte Spiel hatten wir in Platz drei Spitzen: Elber, Jancka und dann Zickler. Wir m√ºssen nicht vergessen Zickler. Zickler ist eine Spitzen mehr, Mehmet eh mehr Basler. Ist klar diese W√∂rter, ist m√∂glich verstehen, was ich hab gesagt? Danke. Offensiv, offensiv ist wie machen wir in Platz.</p>', '1', 'ˇÄªä	ËÂ±z™\0\0ÙaÙ', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', ''),
(6, 1, 1433518650, 'Unser Unternehmen ist 10 Jahre alt!', 'unser-unternehmen-ist-10-jahre-alt-02e7d9d7', 1, 1424338080, 1424338080, '', '<p>Dies ist ein Typoblindtext. An ihm kann man sehen, ob alle Buchstaben da sind und wie sie aussehen. Manchmal benutzt man Worte wie Hamburgefonts, Rafgenduks oder Handgloves, um Schriften zu testen. Manchmal S√§tze, die alle Buchstaben des Alphabets enthalten - man nennt diese S√§tze ¬ªPangrams¬´. Sehr bekannt ist dieser: The quick brown fox jumps over the lazy old dog.</p>', '1', 'ˇÄª}	ËÂ±z™\0\0ÙaÙ', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '');
