(2, 8, 1440525349, 'Hambach', 'index.php/news.html', 'Hambach twitter facebook Google+ Pinterest Hambach Hambach ist ein Ortsteil des s√ºdhessischen Heppenheims an der Bergstra√üe. Die Kreisstadt hat ca. 25.000 Einwohner, ca. 2.000 davon leben in Hambach. Der TSV Hambach selbst z√§hlte am 18.05.2012 genau 802 Mitglieder. Geschichtliches zu Hambach: In einer Schenkungsurkunde von Kaiser Friedrich I., auch Barbarossa genannt, wird der Ort Hambach, damals noch Heimbach genannt, schon im Jahre 1165 erw√§hnt. Im Schatten und Schutze der Starkenburg konnte sich die Gemeinde durch die St√ºrme der Zeit behaupten. Mit der Erstnennung in der kaiserlichen Urkunde kam die damals noch recht kleine Siedlung unter den Schutz der Landesherren. Die Bewohner waren Leibeigene zun√§chst der √Ñbte des Klosters Lorsch, und nach dessen Aufl√∂sung geh√∂rte die Gemeinde zum Erzbistum Mainz. Die kurmainzische Zeit endete f√ºr Hambach 1461. In diesem Jahr wurde das Oberamt Starkenburg vom Kurf√ºrsten von Mainz, Dieter von Isenburg, an den Kurf√ºrsten der Pfalz, Friedrich I., verpf√§ndet. Damit kam Hambach unter pf√§lzische Verwaltung. Nach alten Urkunden √ºber den "Schutztribut", auch Zehnt genannt, reichte die Skala der Anbauprodukte von Kartoffeln √ºber Getreide bis hin zum Wein, der gerade heute im Bergst√§dter Raum eine vorrangige Stellung einnimmt. In wirtschaftlicher Hinsicht waren die Bewohner fr√ºher Bauern, vor allem M√ºller oder Besitzer von M√ºhlen, zu deren Antrieb die Wasserkraft des Bachlaufs genutzt wurde. Daf√ºr spricht der Name Hambach = Hagenbach = eingeengter Bach oder Heimbach. Heute hat sich die Struktur gewandelt. Die beiden ehemals bl√ºhenden Haupterwerbszweige spielen nicht mehr die Rolle wie in fr√ºheren Jahren. Hambach stellt nun eine Wohngemeinde mit zahlreichen Auspendlern dar, die in den nahen Betrieben Arbeit und Besch√§ftigung finden. Quelle: Internet-Seite der Stadt Heppenheim. Falsch ist √ºbrigens, dass es sich hier um das etwas bekanntere Hambach in der Pfalzhandelt, das durch die deutsche Revolution 1848/49 sowie das Hambacher Fest 1832 zu Bekanntheit kam. Informationen Kontakt Impressum FAQ nach oben ¬© TSV Hambach', 19.42, 'e86350fa72e4c54a233bea59785107bc', '', 0x30, 'de'),
