(7, 11, 1442745546, 'Sponsoren', 'index.php/newsletter.html', 'Sponsoren twitter facebook Google+ Pinterest TSV-Hambach sagt Danke! Ohne die Unterst√ºtzung seiner Sponsoren k√∂nnte der TSV Hambach nicht existieren. Denn neben der aufopferungsvollen Arbeit unserer ehrenamtlichen Helfer und Betreuer sind es auch die Gelder unserer Sponsoren, die unseren Verein am Leben erhalten, unsere allseits bekannte und gelobte Jugendarbeit erm√∂glichen und uns beim Vorhaben des Kunstrasenprojektes unterst√ºtzen. An dieser Stelle m√∂chten wir uns bei unseren Partnern und Sponsoren bedanken und bitten unsere Leser, bei ihren K√§ufen die nebenstehenden Firmen zu ber√ºcksichtigen. Aktuelle Trikotspende Die erste Mannschaft des TSV Hambach spielt seit Saisonbeginn 2015 in Trikots von Elektro-Keil. Von ... wurden die Trikots der zweiten Mannschaft gesponsert. Die Sponsoren des TSV-Hambach ABG Industrie und Elektro GmbH Anja Reif Cosmetics Autohaus Wiest Bensheim GGEW Strom.Gas.Wasser Holzbau Vock GmbH Merck Metzgerei Buser Optik Fellmann Prier GmbH Rhein Transporte & Erdbewegungen Sparkasse Starkenbug Wein- und Getr√§nke - Welt Weiser Gastst√§tte zum Steigkopf Informationen Kontakt Impressum FAQ nach oben ¬© TSV Hambach', 27.56, '87482af0ff8afbfc77e6d864836fdc54', '', 0x30, 'de'),
(17, 16, 1443169422, 'Vorstand', 'index.php/die-entstehung.html', 'Vorstand twitter facebook Google+ Pinterest Kontakt TSV Hambach Postfach 13 11 64631 Heppenheim Fax (06252) 7508874 e-Mail Vorstand des TSV Hambach Gesamtverein 1. Vorsitzender Roland Sch√§fer Mobil: 0176/64026516 E-Mail 2. Vorsitzender Heinz Welter Tel.: 06252/74441 E-Mail Schriftf√ºhrer Johannes Schweinsberger Tel.: 06252/603496 E-Mail Rechner Karl-Heinz Roth Tel.: 06252/74243 E-Mail Kultuwart Willi Lerchl Tel.: 06252/76372 E-Mail Jugendwart Alexander Mitsch Tel.: 06252/788490 E-Mail Beisitzer Gerhard Lulay Tel.: 06252/77722 E-Mail Beisitzer Michael Gerards Mobil: 0151/67104849 E-Mail Beisitzerin Doris Schrah Tel.: 06252/77342 E-Mail Beisitzer G√ºnther Rutz Tel.: 06252/76241 Beisitzer Kurt Lerchl Tel.: 06252/73966 Beisitzer Reimung Bommes Tel.: 06252/982424 E-Mail Abteilung Fu√üball Abteilungsleiter Gerd Oravecz Tel.: 06252 966 894 Mobil 0173 88 02 797 Mail Abteilungsleiter Martin Guthier Tel.: 06252 96 66 63 Mobil 0172 82 434 28 Mail Beisitzer Timo Wolff Tel.: 06252 788 576 Mobil 0176 20 641 550 Mail Bild wird noch gemacht Beisitzer Matthias Ragaller Tel.: 06252 71897 Mobil 0171 20 535 86 Mail Abteilung Fu√üball Gerd Oravecz und Martin Guthier f√ºhren die Hambacher Fu√üballabteilung alle Infos Eine Doppelspitze soll es richten ‚ÄûDie Abteilung Fu√üball und auch ich pers√∂nlich haben im vergangenen Jahr durch den pl√∂tzlichen Tod meines Vaters Paul Oravecz einen gro√üen Verlust erlitten‚Äú, sagte Gerd Oravecz in seinem Jahresr√ºckblick bei der Jahreshauptversammlung im Vereinsheim des TSV Hambach. Als seitheriger Stellvertreter musste Oravecz junior nach dem Tod seines Vaters genauso pl√∂tzlich wie unvorbereitet das Amt des kommissarischen Leiters der Fu√üballabteilung √ºbernehmen. Dass er dies zur Zufriedenheit der Fu√üballer getan hat, zeigten der Applaus der anwesenden Mitglieder sowie das einstimmige Votum bei der Wahl des neuen Abteilungsleiters. Unterst√ºtzung erh√§lt Oravecz k√ºnftig von seinem neuen Stellvertreter Martin Guthier. Beide streben eine enge Zusammenarbeit an. ‚ÄûMan nennt diese Form heutzutage eine Doppelspitze‚Äú, sagte Oravecz. Ansonsten hat sich in personeller Hinsicht kaum etwas ge√§ndert: Jugendleiter Markus Hechler, die Spielausschussmitglieder J√ºrgen Vrba, Reinhard Wolff, John Dickson, Ewald Rettig und J√ºrgen Gehrig sowie Beisitzer Matthias Ragaller geh√∂ren dem Gremium schon l√§nger an. Komplettiert wird die Abteilungsf√ºhrung von Beisitzer Timo Wolff und den von der Mannschaft bestimmten Spielf√ºhrer der beiden Seniorenteams. Vakant bleibt der Posten des Pressewarts, die Aufgaben √ºbernehmen vor√ºbergehend andere Vorstandsmitglieder. Vor den Wahlen erstatteten die Abteilungen Bericht. Hauptthemen waren dabei der Abstieg der ersten Mannschaft aus der A-Liga und der sportliche Neuanfang unter dem Trainer-Duo Frank Zimmermann/Andreas Davidowicz. ‚ÄûDie Saison m√ºssen wir als Lehrjahr abhaken‚Äú, sagte Oravecz. Zugleich erinnerte er an die Erfolge der j√ºngeren Vergangenheit, als der TSV unter Trainer Konrad Gutfleisch von der D- in die A-Liga ‚Äûdurchmarschierte‚Äú. Von Gutfleisch hatte sich der Verein im Laufe der vergangenen Saison getrennt, seitdem hat der vorherige Zweitmannschaftstrainer Frank Zimmermann das sportliche Sagen. Er habe den Geist der zweiten Mannschaft, die nun von Spielertrainer Andreas Davidowicz betreut wird, ‚Äûneu geweckt‚Äú, lobte der Abteilungsleiter. Gleiches soll er nun mit der ersten Garnitur in der Kreisliga B erreichen. Oravecz: ‚ÄûIch denke, dass wir am Rundenende im oberen Tabellendrittel zu finden sein sollten ‚Äì sofern alle mitziehen.‚Äú Die gr√∂√üte Abteilung in der Abteilung stellte Jugendleiter Markus Hechler vor. Derzeit sind 120 Kinder und Jugendliche beim TSV aktiv. Ein besonderes Lob des Jugendleiters verdienten sich die G-, F- und E-Junioren, die am vergangenen Wochenende den Heppenheimer Stadtpokal gewannen. Die F-Jugend habe dar√ºber hinaus seit zwei Jahren kein Spiel mehr verloren. Aush√§ngeschild der Jugendabteilung waren zuletzt aber die A-Junioren: Die √§ltesten Nachwuchskicker traten zwar au√üer Konkurrenz an, waren aber in der Kreisklasse nicht zu stoppen. Nun r√ºcken einige Talente zur Freude des Trainer-Duos in den Seniorenkader auf. ‚ÄûDa wir uns bekanntlich vorrangig aus dem eigenen Nachwuchs verst√§rken, ist es an der Zeit, dass wir uns ausdr√ºcklich einmal bei euch bedanken. Ihr leistet eine unglaubliche Leistung ‚Äì nicht nur f√ºr uns, sondern f√ºr den gesamten Verein‚Äú, lobte Zimmermann den Jugendleiter und seine Mitstreiter. Informationen Kontakt Impressum FAQ nach oben ¬© TSV Hambach', 34.39, '2b3a71e2fc1e7993b7d0f861dc7b345d', '', 0x30, 'de'),
