(37, 56, 1447052289, 'Fu√üball', 'index.php/jugend.html', 'Fu√üball twitter facebook Google+ Pinterest Die AH des TSV Hambach Die AH des TSV Hambach Trainingszeiten Mittwoch 19:30 Uhr Die Spieler Bitsch Sebastian, Bohl Daniel, Dambier Markus, Dickson John, Ensinger Philipp, Fink Matthias, Fioretto Nino, Frank Christopher, Frey Carsten, Gerards Michael, Guthier Martin, Herberg Felix, Jakobi Boris, Jenkins Daniel, Kl√ºver Thomas, Kops Daniel, Kratzmeier Frank, Leineweber Oliver, Lerchl Wolfgang, Lienert Stefan, Lulay Tobias, Meon Philipp, Mitsch Alexander, Mitsch Andreas Lothar, Mitsch Marco, Mitsch Martin, Mohr J√ºrgen, Neher Manuel, Oravecz Gerd, Plenk Florian, Post Markus, Praxl Frank, Rettig Willi, Schmidt Roman, Schuster Andreas, Wohlfart Sven, Zimmermann Frank Die "Alten Herren" des TSV Hambach sind gar nicht soo alt - oder meinen es zumindest. Deswegen treffen sie sich jede Woche wieder zu Trainingseinheiten, die ganz wesentlich durch die 3. Halbzeit bestimmt werden. Die Verbindung von Sport und Geselligkeit wird hier gro√ü geschrieben. Der Kader der AH umfasst rund 40 Spieler, die wir aber auch ben√∂tigen, da der Samstag oft auch im Zeichen der Familie steht und es so manchmal schwer f√§llt, die ben√∂tigten 11 bis 15 Spieler zusammen zu bringen. Nichts desto trotz l√§uft der Spielbetrieb das ganze Jahr mit Ausnahme der Ferienzeit. In 2015 wurden 9 der vereinbarten 12 Spiele (3 Absagen der Gegner) absolviert und mit 5 Siegen und einem Unentschieden ein beachtliches, wenngleich auch verbesserungsw√ºrdiges Ergebnis erzielt (Torverh√§ltnis 23:17). Historisch hierbei war der 1:0 Ausw√§rtserfolf der AH √ºber den Lokalrivalen Starkenburgia Heppenheim am letzten Spieltag vor der Sommerpause (18.07.2015). Die Typologie einer Hobby-Fu√üballmannschaft Die Spiele in der √úbersicht: "SPIELTAGE AH 2015" - Bitte hier auch mit Alex sprechen, siehe 1. u. 2. Mannschaft (Spiele, Torsch√ºtzen etc) 14. Februar TSV Hambach - TSV Zweite Mannschaft 2:0 (0:0) Tore AH: Kl√ºver, Bitsch 