(60, 132, 1447140922, 'Turnen', 'index.php/turnen-132.html', 'Turnen twitter facebook Google+ Pinterest Turnen Abteilungsleiterin Conni Pietz Am Kr√§nzenberg 6 64646 Heppenheim Tel.: 06252 / 71177 Ort: Schlo√überghalle Turn und √úbungsstunden, Trainingszeiten (w√∂chentlich) Dienstag: 15:30- 16:30 Uhr Kinderturnen, Alter 4 - 5 Jahre, Leitung: Helga Keaton, Au√üerhalb 6, 64646 Heppenheim, Tel.(06252) 74274, Birgit Wipplinger, Hambacher Tal 173, Tel.(06252) 75781. 16:30- 18:00 Uhr Kinderturnen, Alter ab 6 Jahre, Leitung: Helga Keaton, Au√üerhalb 6, 64646 Heppenheim, Tel.(06252) 74274, Birgit Wipplinger, Hambacher Tal 173, Tel.(06252) 75781. 19:00- 20:00 Uhr Funktionsgymnastik Leitung: Gudrun Schwab, Am Kr√§nzenberg 10, 64646 Heppenheim, Telefon (06252) 75859. Mittwoch: 20:00- 21:30 Uhr Gymnastik Frauen Leitung: Gertrude Fetsch, Burgweg 6, 64646 Heppenheim, Telefon (06252) 76289. Donnerstag: 15:00- 16:00 Uhr Eltern und Kind - Turnen: Alter 2¬Ω bis 4¬Ω Jahre, Leitung: Conni Pietz, Am Kr√§nzenberg 6, 64646 Heppenheim, Telefon (06252) 71177. 16:00- 17:00 Uhr Eltern und Kind - Turnen: Laufalter bis 2¬Ω Jahre, Leitung: Conni Pietz, Am Kr√§nzenberg 6, 64646 Heppenheim, Telefon (06252) 71177 Informationen Kontakt Impressum FAQ nach oben ¬© TSV Hambach , DSCF3440_klein.JPG, DSCF3444_klein.JPG, DSCF3441_klein.JPG, DSCF3442_klein.JPG, DSCF3445_klein.JPG', 24.76, '3dd603cc0b6bff47ab42f62481dd376f', '', 0x30, 'de'),
(61, 129, 1447089752, 'Turnen', 'index.php/wandern.html', 'Turnen twitter facebook Google+ Pinterest Wandern ‚ÄûAn einem hellen Morgen, da nimm den Wanderstab, es fallen alle Sorgen wie Nebel von dir ab.‚Äú Gem√§√ü dieser Empfehlung des deutschen Erz√§hlers Theodor Fontane erf√§hrt die Sparte Wandern beim TSV Hambach seit einem Vierteljahrhundert regen Zuspruch und ein erfolgreiches, naturverbundenes Wirken. Nachdem bereits in den f√ºnfziger und sechziger Jahren ‚Äì im j√§hrlichen Wechsel mit einem Busausflug ‚Äì eine Jahreswanderung vom TSV durchgef√ºhrt wurde, nahm das Wandern in Hambach mit Beginn der siebziger Jahre einen erfreulichen Aufschwung. Der am 30. September 2005 leider verstorbene August Ochs betreute im ersten Jahr 1974 kommissarisch und ab 1975 als gew√§hlter Wanderwart innerhalb der Abteilung Turnen die allzeit beliebte Freizeitbesch√§ftigung und machte das Wandern zu einem festen Bestandteil des Hambacher Vereinslebens. Von 1975 bis 1991 bekleidete Ochs gleichzeitig im Turngau Bergstra√üe das Amt des Gau-Wanderwartes und hat dabei √ºber die Grenzen Hambachs hinaus Pionierarbeit f√ºr den beliebten Breitensport geleistet. Ab 1995 bekleidet nun Gerhard Neher das Amt des Wanderwartes innerhalb der Turnabteilung. √úber die Turnabteilung, zur Leichtathletik, dann als Jogger kam er schlie√ülich zu den Wanderern. Zurzeit z√§hlen etwa 35 Personen zum Kreis der Wanderer, von denen sich wiederum zwischen 15 und 25 an den verschiedenen Wanderungen beteiligen. Hierbei wird nicht nur die n√§here Umgebung auf ‚ÄûSchusters Rappen‚Äú erwandert, sondern auch entfernte Regionen wie der Schwarzwald, der Pf√§lzer Wald und der Taunus aufgesucht. Die Summe der im j√§hrlichen Wanderplan ausgeschriebenen Termine ergibt etwa 15 Wanderungen mit einer Jahresgesamtstrecke von insgesamt 250 ‚Äì 300 km. Eine Radtour mit etwa 50 km L√§nge und ein Wanderwochenende mit zwei √úbernachtungen in einer Jugendherberge runden den Wanderplan ab. Letzteres wird wechselweise seit 1994 von den Wanderfreunden aus Bobstadt, Hambach und Zell organisiert. Seit dem Jahr 2000 wird j√§hrlich Mitte September ein 5-Tage Aufenthalt mit diversen Bergtouren im Allg√§u bzw. im Tannheim (√ñsterreich) durchgef√ºhrt. Die Organisation obliegt j√§hrlich einem anderen Wanderfreund der TSV-Truppe. Gem√§√ü der Devise: ‚ÄûWanderwetter ist immer, es kommt einzig und allein auf die richtige Kleidung an‚Äú Informationen Kontakt Impressum FAQ nach oben ¬© TSV Hambach', 23.34, 'dc0d7570d5fe037bcd0fc4dfd57585db', '', 0x30, 'de'),
